import React from "react";

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center">
      {/* Navigation Bar */}
      <nav className="bg-gray-200 p-4 w-full shadow-md flex justify-between items-center">
        {/* Logo */}
        <div className="font-bold text-lg">SESDC/LOGO HERE</div>

        {/* Navigation Links */}
        <ul className="nav-links flex space-x-8">
          <li><a href="#" className="nav-link">Home</a></li>
          <li><a href="#" className="nav-link">About</a></li>
          <li><a href="#" className="nav-link">Help</a></li>
          <li><a href="#" className="nav-link">Contact Us</a></li>
        </ul>

        {/* Register/Login Buttons */}
        <div className="button-container flex space-x-3">
          <button className="register-btn">Register</button>
          <button className="login-btn">Login</button>
        </div>
      </nav>

      {/* Microgrid Design Tool Section */}
      <section className="hero-section">
        <div className="content-box">
          <div className="grid-container">
            {/* Left side: Title and Button */}
            <div className="text-content">
              <h1 className="title">A user-friendly microgrid design tool</h1>
              <button className="design-tool-button">Open Design Tool</button>
            </div>

            {/* Right side: Graph Placeholder */}
            <div className="graph-placeholder">Graph Placeholder</div>
          </div>
        </div>
      </section>

      {/* Overview Section */}
      <section className="overview-section">
        <div className="overview-content">
          <p>Understanding Our Project: Learn why we created this tool and how it benefits users.</p>
          <button className="get-started">Get Started!</button>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
